INSERT INTO `itm_posts` VALUES (1,1,2,2,0,'89.154.218.33',1379608424,1,0,1,1,1,1,'','Bem vindos ao fórum de discussão sobre Poder Local da TIAC!','Este fórum, moderado pela Transparência e Integridade, Associação Cívica, pretende ser um espaço de cruzamento de ideias e opiniões sobre o trabalho de investigação da associação em questões municipais, e sobre a qualidade da governança local em geral.\n\nPara participar basta registar-se. Todas as opiniões, críticas e sugestões são bem vindas. Não fugiremos à controvérsia, mas não permitiremos ataques pessoais ou insultos de qualquer espécie, nem participações que fujam ao âmbito do debate: a transparência, integridade e qualidade do Poder Local. \n\nA elevação do debate público é uma medida da qualidade da cidadania. Queremos cidadãos informados, participativos e empenhados na melhoria das instituições. Bom debate!','76e9994423311a7a3924db2e79bcd5e2',0,'','305g2bj2',1,0,'',0,0,0),(2,2,2,59,0,'88.214.180.192',1383166501,0,0,1,1,1,1,'','problemas de visibilidade','bem gostava de fazer uma sugestão que é para quem utiliza um notebook como é o meu caso, o site não dá para ver todo no ecran e assim perco algumas funcionalidades, já descobri que uma forma de contornar este problema é diminuir o zoom no google, mas assim tambem vejo pior...não percebo nada de informatica, mas julgo com o tempo este site pode ficar mais &quot;amigo&quot; para o utilizador...de resto parece me que esta tudo muito bom e com bastante informação relevante sobre esta area...vou ter que investigar mais para poder dar mais sugestões...cumprimentos','104d3405314bb6a9b839c2b416fe9827',0,'','txgl034h',1,0,'',0,0,0),(3,3,2,59,0,'88.214.180.192',1383166516,1,0,1,1,1,1,'','problemas de visibilidade','bem gostava de fazer uma sugestão que é para quem utiliza um notebook como é o meu caso, o site não dá para ver todo no ecran e assim perco algumas funcionalidades, já descobri que uma forma de contornar este problema é diminuir o zoom no google, mas assim tamb